int dis[105], n, d;
int cost[105][105];
int input[105];
int x[105], y[105];
int judge[105];
int abss(int x) {
  if (x < 0)
    return -x;
  else
    return x;
}
void solve() {
  fill(dis, dis + n + 1, 100000000);
  memset(judge, 0, sizeof(judge));
  int x;
  dis[1] = 0;
  while (true) {
    x = -1;
    for (int i = 1; i <= n; i++) {
      if (judge[i] == 0 && (x == -1 || dis[i] < dis[x])) x = i;
    }
    if (x == -1) break;
    judge[x] = 1;
    for (int i = 1; i <= n; i++) {
      dis[i] = min(dis[i], dis[x] + cost[x][i]);
    }
  }
  return;
}
