int n, m, k;
int maz[N][N], id[100005], c[N];
int fa[100005];
void init() {
  for (int i = 1; i <= k; i++) {
    for (int j = 1; j <= k; j++) {
      maz[i][j] = inf;
    }
    maz[i][i] = 0;
  }
}
int find(int x) { return fa[x] == x ? x : (fa[x] = find(fa[x])); }
void input() {
  int sum = 0;
  for (int i = 1; i <= k; i++) {
    scanf("%d", &c[i]);
    for (int j = sum + 1; j <= sum + c[i]; j++) id[j] = i;
    sum += c[i];
  }
  for (int i = 1; i <= n; i++) fa[i] = i;
  int u, v, x;
  while (m--) {
    scanf("%d%d%d", &u, &v, &x);
    if (u > n || v > n) continue;
    if (x == 0) {
      int uf = find(u), vf = find(v);
      fa[uf] = vf;
    }
    if (id[u] == id[v])
      continue;
    else {
      u = id[u], v = id[v];
      if (maz[u][v] > x) maz[u][v] = maz[v][u] = x;
    }
  }
